import React from 'react'
import { useState } from 'react'
const MainPage2 = () => {
    const [state, setState] = useState("A")
    return (
        <div>
            <h1>{state}</h1>
            <button onClick={() => setState("hi")}>Click</button>
        </div>
    )
}

export default MainPage2


